        return(
            <div>
                <Share/>
                <Post/>
            </div> 
        )
    }

    const ProfileFeed = () => {
        return(
            <div>
                <Share/>
                <Post/>
            </div> 
        )
    }

    return (
        <div className="feed">
            <div className="feed-items">
                <ProfileFeed/>
            </div>
        </div>
    )
}
